import React from 'react';
import styled from 'styled-components/macro';


export default function ProfilePage() {

    return(
        <ProfileForm>
            <h1>Please log in</h1>
            <label for="username" />
            <input name="username" required type="text" placeholder="please enter your name" />
            <label for="password" />
            <input name="password" required type="password" placeholder="please enter your password" />
            <SubmitButton>log in</SubmitButton>
            <LoggedInMessage>Hallo Gadget!</LoggedInMessage>
        </ProfileForm>
    );
}

const ProfileForm = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`

const Input = styled.input`
    background-color: ivory;
    color: #111;
    border-radius: 5px;
`

const SubmitButton = styled.button`
    color: #111;
    width: 100px;
    height: 40px;
    border-radius: 5px;
`

const LoggedInMessage = styled.h2`
    color: #111;

`
